import React from 'react';
import './Discover.css';
import Discover from './DiscoverTrailers';

function OnTv (props){
    let homeOnTv;
    if(props.ontv){
       homeOnTv=props.ontv.map(tv=>{
            return <Discover
         tv={tv} 
         key={tv.id}
         />

        })
    }
    return(
        <div className="content">   
        <div className="discover">
        {homeOnTv}
        </div>      

        </div>
    )
}

export default OnTv;
